import React from 'react'

export default function Counter(props) {

  return (
    <h1
      style=
      {{margintop: '1.5rem',
        color: "{props.davo ? '#32b8bf' :  'hsl(0, 82%, 49%)')}"
      }}
    >{props.counter}</h1>
  )
}
